import React, { useState } from "react";
import Button from '@mui/material/Button';

export const Signup = (props) => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
    }
    return (
        <div className="auth-form">
            <form className = "signup-form" onSubmit={handleSubmit}>
                <label for="email">Enter Your Email: </label>
                <input value={email} type="email" placeholder="example@gmail.com" />
                <label for="password">Choose Your Password: </label>
                <input value={password} type="password" placeholder="**********" />
                <Button variant = "contained" type = "submit">Log In!</Button>
            </form>
            <Button variant = "contained" onClick={() => props.onFormSwitch('Signin')}>Already have an account? Login here!</Button>
        </div>
    )
}
